import { createRouter, createWebHistory } from 'vue-router'
//Home Page
import HomeComponent from '../components/layouts/HomeBanner.vue';
//Important Pages Routes
import AboutUs from '../components/pages/FrontEnd/ImportantPages/AboutUs.vue';
import ContactUs from '../components/pages/FrontEnd/ImportantPages/ContactUs.vue';
// Auth Routes
import LoginComponent from '../components/pages/Auth/Login.vue';
import Registration from '../components/pages/Auth/Registration.vue';
import SellerRegistration from '../components/pages/Auth/SellerRegistration.vue';
import affiliateRegistration from '../components/pages/Auth/AffiliateRegistration.vue';
import Blog from '../components/pages/FrontEnd/Blog.vue';
import Categories from '../components/pages/FrontEnd/Categories.vue';
import AllJobs from '../components/pages/FrontEnd/AllJobs.vue';
// Order Routes
import TrackOrder from '../components/pages/FrontEnd/Order/TrackOrder.vue';
//Product Routes
import SingleProduct from '../components/layouts/ProductComponents/SingleProduct.vue';
import CategoryWiseProduct from '../components/layouts/ProductComponents/CategoryWiseProduct.vue';

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeComponent
  },
  {
    path: '/users/login',
    name: 'login',
    component: LoginComponent
  },
  {
    path: '/users/registration',
    name: 'registration',
    component: Registration
  },
  {
    path: '/shops/create',
    name: 'sellerRegistration',
    component: SellerRegistration
  },
  {
    path: '/affiliate',
    name: 'affiliateRegistration',
    component: affiliateRegistration
  },
  {
    path: '/blog',
    name: 'blog',
    component: Blog
  },
  {
    path: '/categories',
    name: 'Categories',
    component: Categories
  },
  {
    path: '/all_jobs',
    name: 'AllJobs',
    component: AllJobs
  },
  {
    path: '/track-your-order',
    name: 'trackOrder',
    component: TrackOrder
  },
  {
    path: '/category',
    name: 'CategoryWiseProduct',
    component: CategoryWiseProduct
  },
  {
    path: '/single-product',
    name: 'singleProduct',
    component: SingleProduct
  },
//important pages
{
  path: '/about-us',
  name: 'About',
  component: AboutUs
},
{
  path: '/Contact-Us',
  name: 'ContactUs',
  component: ContactUs
},
{
  path: '/Cookie-Policy',
  name: 'CookiePolicy',
  component: CookiePolicy
},
{
  path: '/privacy-policy',
  name: 'PrivacyPolicy',
  component: PrivacyPolicy
},
{
  path: '/terms',
  name: 'terms',
  component: Terms
},
{
  path: '/terms',
  name: 'terms',
  component: Terms
},
{
  path: '/terms',
  name: 'terms',
  component: Terms
},
  
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
